import React from 'react';

const EnvTest = () => {
  return (
    <div className="p-4 bg-white rounded-lg shadow">
      <h2 className="text-xl font-bold mb-4">Environment Variables Test</h2>
      <div className="space-y-2">
        <p><strong>API URL:</strong> {process.env.REACT_APP_API_URL}</p>
        <p><strong>Auth Enabled:</strong> {process.env.REACT_APP_AUTH_ENABLED}</p>
        <p><strong>Google Client ID:</strong> {process.env.REACT_APP_GOOGLE_CLIENT_ID ? 'Set' : 'Not Set'}</p>
        <p><strong>Analytics Enabled:</strong> {process.env.REACT_APP_ENABLE_ANALYTICS}</p>
        <p><strong>Node Environment:</strong> {process.env.NODE_ENV}</p>
      </div>
    </div>
  );
};

export default EnvTest;
